<table width="100%" border="0" cellpadding="5" cellspacing="0" id="detail">
  <tr>
    <td colspan="2" class="minititle"><p>■商品仕様</p></td>
  </tr>
  <tr>
    <td><p>サイズ</p></td>
    <td><p>本体：幅約48cm×高さ約37cm×奥行約32cm×座面高約23cm（若干の誤差がある場合があります。）</p></td>
  </tr>
  <tr>
    <td valign="top"><p>素材</p></td>
    <td><p>本体：籐</p>
      <p>クッション中身：ウレタン</p>
      <p>クッション側地：ポリエステル</p>
    <p>塗装：ラッカー　グロス　80％</p></td>
  </tr>
  <tr>
    <td><p>生産国</p></td>
    <td><p>インドネシア製</p></td>
  </tr>
  <tr>
    <td colspan="2" class="minititle"><p>■商品コメント</p></td>
  </tr>
  <tr>
    <td colspan="2">
     <p>◆玄関にひとつあると重宝する玄関スツール。     
     <p>◆靴の着脱の際はもちろん、荷物置きとしても、また腰かけにしても、使い方はさまざまなアイテムです。
    <p>◆籐素材でできているので、軽くて、丈夫、そして長持ち！と3拍子揃ったお得なアイテムです。</td>
  </tr>
  <tr>
    <td colspan="2" class="minititle"><p>■ご注文に際しての注意</p></td>
  </tr>
  <tr>
    <td colspan="2" class="img_atten">
     <p>掲載している商品画像は、実際の色味を再現できるよう調整しておりますが、ご覧頂いておりますPCモニタ・携帯端末の画面等の環境や、実際に敷くお部屋の照明等の光加減に左右されますので、予めご了承の上ご注文くださいますようお願い致します。</p>
    </td>
  </tr>
</table><div id="new_item_bn">
  <img src="http://image.rakuten.co.jp/auc-storepocket/cabinet/parts/new_item.jpg" width="675" alt="新作商品一覧"/>
